  `dibayar` bigint NOT NULL,
  `keterangan` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `status` int NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `transaksi_id` (`transaksi_id`),
  KEY `tanggal` (`tanggal`),
  CONSTRAINT `t_pembayaran_ibfk_2` FOREIGN KEY (`transaksi_id`) REFERENCES `t_transaksi` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_pengaturan`;
CREATE TABLE `t_pengaturan` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `user_id` int NOT NULL,
  `pemberitahuan_otomatis` int DEFAULT '0',
  `pengingat_kalender` int DEFAULT '1',
  `masuk_sidik_jari` int DEFAULT '0',
  `pemberitahuan_map` int DEFAULT '0',
  KEY `user_id` (`user_id`),
  CONSTRAINT `t_pengaturan_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_principal`;
CREATE TABLE `t_principal` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nama` varchar(100) NOT NULL,
  `flag` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `t_produk`;
CREATE TABLE `t_produk` (
  `id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `depo_id` int NOT NULL DEFAULT '1',
  `kode_produk` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `ikon` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `satuan_id` int DEFAULT NULL,
  `kategori_id` int DEFAULT NULL,
  `kategori2_id` int DEFAULT NULL,
  `nama` varchar(200) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `deskripsi` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `stok` int NOT NULL,
  `bad_stok` int NOT NULL DEFAULT '0',
  `harga` bigint NOT NULL COMMENT 'idr',
  `target_penjualan` int NOT NULL DEFAULT '100',
  `ref_produk` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `pajak` float DEFAULT '0',
  `promo_1` float NOT NULL DEFAULT '0',
  `promo_2` float NOT NULL DEFAULT '0',
  `promo_3` float NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `created_by` int NOT NULL,
  `flag` int NOT NULL DEFAULT '1',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `deleted_by` int DEFAULT NULL,
  `principal_id` int NOT NULL DEFAULT '1',
  `satuan_terkecil` int NOT NULL DEFAULT '0',
  `rasio` int DEFAULT NULL,
  `rasio_terhadap` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `created_by` (`created_by`),
  KEY `nama` (`nama`),
  KEY `kategori_id` (`kategori_id`),
  KEY `satuan_id` (`satuan_id`),
  KEY `ref_produk` (`ref_produk`),
  KEY `kode_produk` (`kode_produk`),
  KEY `stok` (`stok`),
  KEY `harga` (`harga`),
  KEY `deleted_by` (`deleted_by`),
  KEY `kategori2_id` (`kategori2_id`),
  KEY `depo_id` (`depo_id`),
  KEY `principal_id` (`principal_id`),
  CONSTRAINT `t_produk_ibfk_1` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_produk_ibfk_2` FOREIGN KEY (`kategori_id`) REFERENCES `t_produk_kategori` (`id`),
  CONSTRAINT `t_produk_ibfk_3` FOREIGN KEY (`satuan_id`) REFERENCES `t_master_satuan` (`id`),
  CONSTRAINT `t_produk_ibfk_4` FOREIGN KEY (`ref_produk`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_produk_ibfk_5` FOREIGN KEY (`deleted_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_produk_ibfk_6` FOREIGN KEY (`kategori2_id`) REFERENCES `t_produk_kategori` (`id`),
  CONSTRAINT `t_produk_ibfk_7` FOREIGN KEY (`depo_id`) REFERENCES `t_depo` (`id`),
  CONSTRAINT `t_produk_ibfk_8` FOREIGN KEY (`principal_id`) REFERENCES `t_principal` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_produk_histori`;
CREATE TABLE `t_produk_histori` (
  `id` int NOT NULL AUTO_INCREMENT,
  `tanggal` date NOT NULL,
  `produk_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `sales_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL COMMENT 'jika-diambil-oleh-sales',
  `tipe` enum('masuk','keluar') CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `jumlah` int NOT NULL COMMENT 'jumlah-ambil/jumlah-masuk',
  `stok_lama` int NOT NULL,
  `stok_baru` int NOT NULL,
  `keterangan` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `ref_produk` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `created_by` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `produk_id` (`produk_id`),
  KEY `sales_id` (`sales_id`),
  KEY `created_by` (`created_by`),
  KEY `tanggal` (`tanggal`),
  KEY `ref_produk` (`ref_produk`),
  CONSTRAINT `t_produk_histori_ibfk_1` FOREIGN KEY (`produk_id`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_produk_histori_ibfk_2` FOREIGN KEY (`sales_id`) REFERENCES `t_sales` (`id`),
  CONSTRAINT `t_produk_histori_ibfk_3` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_produk_histori_ibfk_4` FOREIGN KEY (`ref_produk`) REFERENCES `t_produk` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_produk_kategori`;
CREATE TABLE `t_produk_kategori` (
  `id` int NOT NULL AUTO_INCREMENT,
  `nama` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `flag` int NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `nama` (`nama`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_promo`;
CREATE TABLE `t_promo` (
  `id` int NOT NULL AUTO_INCREMENT,
  `tanggal_mulai` date NOT NULL,
  `tanggal_selesai` date NOT NULL,
  `produk_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `jumlah_beli_minimum` int NOT NULL,
  `jumlah_gratis` int NOT NULL,
  `keterangan` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `limit` int DEFAULT NULL,
  `hint` int NOT NULL DEFAULT '0' COMMENT 'jumlah-yang-telah-di-klaim',
  PRIMARY KEY (`id`),
  KEY `produk_id` (`produk_id`),
  CONSTRAINT `t_promo_ibfk_1` FOREIGN KEY (`produk_id`) REFERENCES `t_produk` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_promo_klaim`;
CREATE TABLE `t_promo_klaim` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `transaksi_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `transaksi_detail_id` bigint NOT NULL,
  `promo_id` int NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `transaksi_id` (`transaksi_id`),
  KEY `transaksi_detail_id` (`transaksi_detail_id`),
  KEY `promo_id` (`promo_id`),
  CONSTRAINT `t_promo_klaim_ibfk_1` FOREIGN KEY (`transaksi_id`) REFERENCES `t_transaksi` (`id`),
  CONSTRAINT `t_promo_klaim_ibfk_2` FOREIGN KEY (`transaksi_detail_id`) REFERENCES `t_transaksi_detail` (`id`),
  CONSTRAINT `t_promo_klaim_ibfk_3` FOREIGN KEY (`promo_id`) REFERENCES `t_promo` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_sales`;
CREATE TABLE `t_sales` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `user_id` int NOT NULL,
  `nama` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `kode_sales` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `no_hp` varchar(20) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `email` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `tipe` int DEFAULT '1' COMMENT '1 saes biasa, 2 canvas, 99 supervisor',
  `pos_lat` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `pos_long` varchar(30) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `target_unit` int NOT NULL DEFAULT '100',
  `target_rupiah` decimal(30,0) NOT NULL DEFAULT '1500000',
  `alamat` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `flag` int NOT NULL DEFAULT '1',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `deleted_by` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `kode_sales` (`kode_sales`),
  KEY `user_id` (`user_id`),
  KEY `nama` (`nama`),
  KEY `email` (`email`),
  KEY `deleted_by` (`deleted_by`),
  CONSTRAINT `t_sales_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `t_sales_ibfk_2` FOREIGN KEY (`deleted_by`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_sales_target`;
CREATE TABLE `t_sales_target` (
  `id` int NOT NULL AUTO_INCREMENT,
  `sales_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `target_rupiah` decimal(20,0) NOT NULL,
  `target_unit` int NOT NULL,
  `bulan` int NOT NULL,
  `tahun` year NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `created_by` int NOT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `updated_by` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `created_by` (`created_by`),
  KEY `updated_by` (`updated_by`),
  KEY `sales_id` (`sales_id`),
  CONSTRAINT `t_sales_target_ibfk_1` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_sales_target_ibfk_2` FOREIGN KEY (`updated_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_sales_target_ibfk_3` FOREIGN KEY (`sales_id`) REFERENCES `t_sales` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_stok_moving`;
CREATE TABLE `t_stok_moving` (
  `id` int NOT NULL AUTO_INCREMENT,
  `transaksi_masuk_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `produk_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `jumlah` int NOT NULL,
  `terjual` int NOT NULL,
  `harga` int NOT NULL,
  `exp_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `product_id` (`produk_id`),
  KEY `transaksi_masuk_id` (`transaksi_masuk_id`),
  CONSTRAINT `t_stok_moving_ibfk_1` FOREIGN KEY (`produk_id`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_stok_moving_ibfk_2` FOREIGN KEY (`transaksi_masuk_id`) REFERENCES `t_transaksi_masuk` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `t_toko_sales`;
CREATE TABLE `t_toko_sales` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `toko_id` int NOT NULL,
  `sales_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `jadwal_kunjungan` date NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `toko_id` (`toko_id`),
  KEY `sales_id` (`sales_id`),
  CONSTRAINT `t_toko_sales_ibfk_1` FOREIGN KEY (`toko_id`) REFERENCES `t_master_toko` (`id`),
  CONSTRAINT `t_toko_sales_ibfk_2` FOREIGN KEY (`sales_id`) REFERENCES `t_sales` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_toko_stok`;
CREATE TABLE `t_toko_stok` (
  `id` int NOT NULL AUTO_INCREMENT,
  `produk_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `toko_id` int NOT NULL,
  `stok` int NOT NULL DEFAULT '0',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_by` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `produk_id` (`produk_id`),
  KEY `toko_id` (`toko_id`),
  KEY `updated_by` (`updated_by`),
  CONSTRAINT `t_toko_stok_ibfk_1` FOREIGN KEY (`produk_id`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_toko_stok_ibfk_2` FOREIGN KEY (`toko_id`) REFERENCES `t_master_toko` (`id`),
  CONSTRAINT `t_toko_stok_ibfk_3` FOREIGN KEY (`updated_by`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_transaksi`;
CREATE TABLE `t_transaksi` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `no_faktur` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `no_faktur_pajak` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `no_surat_jalan` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `no_po` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `sales_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `toko_id` int NOT NULL,
  `tanggal_penjualan` datetime NOT NULL,
  `tanggal_pengiriman` date DEFAULT NULL,
  `tanggal_jatuh_tempo` date DEFAULT NULL,
  `tanggal_diterima_toko` date DEFAULT NULL,
  `jumlah_barang` int NOT NULL,
  `jumlah_angsur` int NOT NULL DEFAULT '1',
  `total_harga_pkp` decimal(20,0) NOT NULL DEFAULT '0',
  `total_harga` decimal(20,0) NOT NULL,
  `total_dibayarkan` decimal(20,0) NOT NULL,
  `diskon_value` float NOT NULL DEFAULT '0' COMMENT 'Diskon yang didapatkan dari nilai harga pembelian, dalam persen',
  `diskon_top` float NOT NULL DEFAULT '0' COMMENT 'Diskon yang didapatkan jika langsung bayar tanpa cicilan dan tidak melewati batas waktu, dalam persen',
  `diskon_cash` float NOT NULL DEFAULT '0' COMMENT 'diskon yang didapat ketika langsung membayar cash',
  `diskon_toko` float NOT NULL DEFAULT '0',
  `nilai_diskon_value` decimal(20,0) NOT NULL DEFAULT '0',
  `nilai_diskon_top` decimal(20,0) NOT NULL DEFAULT '0',
  `nilai_diskon_cash` decimal(20,0) NOT NULL DEFAULT '0',
  `nilai_diskon_toko` decimal(20,0) NOT NULL DEFAULT '0',
  `prosentase_ppn` decimal(3,2) DEFAULT '0.00',
  `nilai_ppn` decimal(20,0) DEFAULT '0',
  `total_harga_diskon_pkp` decimal(20,0) NOT NULL DEFAULT '0',
  `total_harga_diskon` decimal(20,0) NOT NULL DEFAULT '0',
  `total_kembalian` decimal(20,0) DEFAULT NULL,
  `keterangan` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `status` int NOT NULL DEFAULT '1' COMMENT '0:belum lunas;1:sudah lunas',
  `foto_diterima_toko` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `tanggal_top` date DEFAULT NULL,
  `flag` int NOT NULL DEFAULT '1',
  `tanggal_cetak` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sales_id` (`sales_id`),
  KEY `toko_id` (`toko_id`),
  KEY `no_faktur` (`no_faktur`),
  KEY `tanggal_penjualan` (`tanggal_penjualan`),
  KEY `jumlah_barang` (`jumlah_barang`),
  CONSTRAINT `t_transaksi_ibfk_2` FOREIGN KEY (`sales_id`) REFERENCES `t_sales` (`id`),
  CONSTRAINT `t_transaksi_ibfk_3` FOREIGN KEY (`toko_id`) REFERENCES `t_master_toko` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_transaksi_antrian`;
CREATE TABLE `t_transaksi_antrian` (
  `uuid` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `timestamp` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `user_id` int NOT NULL,
  PRIMARY KEY (`uuid`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `t_transaksi_antrian_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_transaksi_detail`;
CREATE TABLE `t_transaksi_detail` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `transaksi_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `barang_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `harga` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `harga_diskon` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL DEFAULT '0' COMMENT 'harga-diskon-per-produk',
  `jumlah` int NOT NULL,
  `pajak` float NOT NULL DEFAULT '0',
  `diskon_promo_1` float NOT NULL DEFAULT '0',
  `diskon_promo_2` float NOT NULL DEFAULT '0',
  `diskon_promo_3` float NOT NULL DEFAULT '0',
  `diskon_toko` float NOT NULL DEFAULT '0',
  `diskon_harga` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL DEFAULT '0',
  `total_harga` decimal(20,0) NOT NULL,
  `harga_asli` decimal(20,0) NOT NULL,
  `keterangan` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `jenis_retur` smallint DEFAULT NULL,
  `jumlah_retur` int DEFAULT NULL,
  `jumlah_badstock` int DEFAULT NULL,
  `jumlah_goodstock` int DEFAULT NULL,
  `nilai_retur` float DEFAULT NULL,
  `konfirmasi_kepaladepo` datetime DEFAULT NULL,
  `stok_moving` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  PRIMARY KEY (`id`),
  KEY `transaksi_id` (`transaksi_id`),
  KEY `barang_id` (`barang_id`),
  CONSTRAINT `t_transaksi_detail_ibfk_2` FOREIGN KEY (`barang_id`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_transaksi_detail_ibfk_3` FOREIGN KEY (`transaksi_id`) REFERENCES `t_transaksi` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_transaksi_masuk`;
CREATE TABLE `t_transaksi_masuk` (
  `id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `no_faktur` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `no_surat_jalan` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci DEFAULT NULL,
  `tanggal_penjualan` datetime NOT NULL,
  `tanggal_pengiriman` date DEFAULT NULL,
  `tanggal_top` date DEFAULT NULL,
  `total_harga` decimal(20,0) NOT NULL,
  `keterangan` text CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci,
  `status` int NOT NULL DEFAULT '1' COMMENT '0:belum lunas;1:sudah lunas',
  `flag` int NOT NULL DEFAULT '1',
  `created_by` int NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_by` int NOT NULL,
  `updated_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `created_by` (`created_by`),
  KEY `updated_by` (`updated_by`),
  CONSTRAINT `t_transaksi_masuk_ibfk_1` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_transaksi_masuk_ibfk_2` FOREIGN KEY (`updated_by`) REFERENCES `user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


DROP TABLE IF EXISTS `t_transaksi_masuk_detail`;
CREATE TABLE `t_transaksi_masuk_detail` (
  `id` int NOT NULL AUTO_INCREMENT,
  `transaksi_masuk_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `produk_id` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `jumlah` int NOT NULL,
  `harga_satuan_beli` double(20,0) NOT NULL,
  `exp_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `product_id` (`produk_id`),
  KEY `transaksi_masuk_id` (`transaksi_masuk_id`),
  CONSTRAINT `t_transaksi_masuk_detail_ibfk_1` FOREIGN KEY (`produk_id`) REFERENCES `t_produk` (`id`),
  CONSTRAINT `t_transaksi_masuk_detail_ibfk_2` FOREIGN KEY (`transaksi_masuk_id`) REFERENCES `t_transaksi_masuk` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `t_transaksi_masuk_pembayaran`;
CREATE TABLE `t_transaksi_masuk_pembayaran` (
  `id` int NOT NULL AUTO_INCREMENT,
  `transaksi_masuk_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_unicode_ci NOT NULL,
  `tanggal` date NOT NULL,
  `nominal` double NOT NULL,
  `created_by` int NOT NULL,
  `created_at` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `created_by` (`created_by`),
  KEY `transaksi_masuk_id` (`transaksi_masuk_id`),
  CONSTRAINT `t_transaksi_masuk_pembayaran_ibfk_1` FOREIGN KEY (`created_by`) REFERENCES `user` (`id`),
  CONSTRAINT `t_transaksi_masuk_pembayaran_ibfk_2` FOREIGN KEY (`transaksi_masuk_id`) REFERENCES `t_transaksi_masuk` (`id`)
