  UNIQUE KEY `username` (`username`),
  KEY `role_id` (`role_id`),
  KEY `depo_id` (`depo_id`),
  CONSTRAINT `user_ibfk_1` FOREIGN KEY (`role_id`) REFERENCES `role` (`id`),
